// frontend/src/App.js
import React from "react";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import HomePage from "./pages/HomePage";
import MatchDetailPage from "./pages/MatchDetailPage";
import Header from "./components/Layout/Header";
import HistoryPage from "./pages/HistoryPage"; // Импортируем новую страницу
import TablesPage from "./pages/TablesPage"; // Импортируем новую страницу
import "./App.css"; // Если есть глобальные стили для App, помимо index.css

function App() {
  return (
    <Router>
      <div className="flex flex-col min-h-screen bg-brand-bg text-brand-text-light">
        <Header />
        <main className="flex-grow container mx-auto px-4 py-8 pt-16">
          <Routes>
            <Route path="/" element={<HomePage />} />
            <Route path="/match/:matchId" element={<MatchDetailPage />} />
            <Route path="/history" element={<HistoryPage />} />{" "}
            {/* Новый роут */}
            <Route path="/tables" element={<TablesPage />} /> {/* Новый роут */}
          </Routes>
        </main>
      </div>
    </Router>
  );
}

export default App;
